import React from 'react'
import './video.css';
const Video = () => {
  return (
    <div className='video'>
      <div className='videoPostSection'>
        <div className='video_youtube'>
            <video width="400" controls autoPlay className='video_youtube_video'></video>
        </div>
      </div>
    </div>
  )
}

export default Video;
